import { Component, Input, OnInit } from '@angular/core';
import { environment } from 'src/environments/environment';

@Component({
  selector: 'app-card-car',
  templateUrl: './card-car.component.html',
  styleUrls: ['./card-car.component.scss']
})
export class CardCarComponent implements OnInit {

  @Input() nome!: string;
  @Input() marca!: string;
  @Input() modelo!: string;
  @Input() imagem!: string;
  @Input() preco!: number;
  @Input() d_alt!: string;



  constructor() {
    console.log('to aqui', environment.api);
  }

  ngOnInit(): void {
  }

}
<div class="card" style="width: 18rem;">
  <img src="{{imagem}}" class="card-img-top" alt="{{d_alt}}">
  <div class="card-body">
    <h5 class="card-title">{{nome}} Onix</h5>
    <p class="card-text">{{marca}} Chevrolet</p>
    <p class="card-text">{{modelo}} 2017</p>
    <p class="card-text">{{preco}} 38.990,00</p>
  </div>
</div>
